import React from 'react';

const UserManual = () => {
  return (
    <div className="user-manual-container">
      <h2>User Manual</h2>
      <p>
        Here you can describe how to use Dobby, tips and tricks, voice commands, etc.
      </p>
    </div>
  );
};

export default UserManual;
